import tkinter as tk
from tkinter import ttk
import ChinaIDAnalyLib as CINA
from tkinter import messagebox
import webbrowser


def query():
    n = entry.get()
    try:
        obj = CINA.CNID(n)
    except CINA.IDError as e:
        messagebox.showerror('错误',
                             f'您输入了错误的身份证号！请检查！\n原因：{e.reason}')
    else:
        outpuT.delete("0.0", "end")
        for i in tree.get_children():
            tree.delete(i)

        outpuT.insert("0.0", obj.msg())
        info = obj.info()

        keys = ['出生地', '出生日期(公历)', '出生日期(农历)', '出生日期(天干地支)',
                '年龄', '性别', '成年', '生肖', '星座', '顺序码']
        values = [info['birthplace'], '-'.join(info['birthdate']['gregorian']), ''.join(info['birthdate']['lunar']), 
                  ''.join(info['birthdate']['ganzhi']), info['age'], info['gender'], '是' if info['adult'] else '否',
                  info['zodiac'], info['star_sign'], info['order']]

        for k in keys:
            item = [k, values[keys.index(k)]]
            tree.insert('', 'end', values=item, )


# 窗口初始化
win = tk.Tk()
win.title('大陆身份证分析库 GUI  |  By @灰尘疾客')
sw = win.winfo_screenwidth()
sh = win.winfo_screenheight()

try:
    win.iconbitmap("id.ico")
except:
    from base64 import b64decode
    from os import remove
    b64data = b''
    with open('id.ico', 'wb') as f:
        f.write(b64decode(b64data))
    win.iconbitmap("id.ico")
    remove('id.ico')

ww, wh = 600, 500
x, y = (sw-ww) / 2, (sh-wh) / 2
win.geometry("%dx%d+%d+%d" % (ww, wh, x, y))
win.resizable(False, False)

menubar = tk.Menu(win)
aboutmenu = tk.Menu(menubar, tearoff=0)

menubar.add_cascade(label='关于', menu=aboutmenu)
aboutmenu.add_command(label='开源仓库', command=lambda: webbrowser.open(
    'https://github.com/gkcoll/ChinaIDAnalyLib'))
aboutmenu.add_command(
    label='作者博客', command=lambda: webbrowser.open('https://www.gkcoll.xyz'))
aboutmenu.add_command(label='联系作者', command=lambda: messagebox.showinfo(
    '关于联系', '看来你很想找事啊！\n说吧，你到底要干什么？\n如果是 BUG 反映，请直达仓库；\n若有他事联系作者，请通过作者博客。'))
aboutmenu.add_command(label='关于程序', command=lambda: messagebox.showinfo(
    '关于程序', '本软件是开发者 @灰尘疾客 基于其开源的一个中国大陆身份证号分析库项目—— ChinaIDAnalyLib 开发的，旨在帮助小白体验该项目。该项目可通过『关于』->『开源仓库』查看。'))
win.config(menu=menubar)

# 创建身份证号输入框
entry = tk.Entry(win, show=None, font=('Times New Roman', 14))
entry.place(x=170, y=14)

# 创建查询按钮
query_button = tk.Button(win, width=10, height=1, text="查询", command=query)
query_button.place(x=370, y=10)

# 创建消息框
outpuT = tk.Text(win, width=50, height=3, font=('思源宋体 CN', 12))
outpuT.grid(padx=75, pady=60)

# 创建信息表格
tree = ttk.Treeview(win, show="headings")
tree['columns'] = ('参数', '内容')
tree.column('参数', width=200, anchor="center")
tree.column('内容', width=200, anchor="center")
tree.heading('参数', text='参数', anchor="center")
tree.heading('内容', text='内容', anchor="center")
tree.grid()

win.mainloop()
